    #对京东网站的地址信息进行统计，统计买的次数和买的总额
    def get_address_info(self,oid):
        aa=self.findalldata(oid)
        d={}
        #创建空的字典
        for i in aa:
            # for y in i:
            #     print y,

            # print ''
            if i[3] in d:
                # print 'exit'
                pass
            else:
                d[i[3]]=[]

        # print d
        # for i in d:
        #     print i,d[i]

        #给空的字典中的values添加新的值
        for i in aa:
            L=[i[0],int(i[1]),i[2],float(i[4]),i[5]]

            d[i[3]].append(L)

        for data in d:
            sumdata={}
            shangping_num=0
            money=0
            phone=[]
            timelist=[]
            namelist=[]
            for L in d[data]:
                shangping_num+=L[1]

                timelist.append(L[0])
                money+=L[3]
                if L[4] in phone:
                    pass
                else:phone.append(L[4])
                if L[2] in namelist:pass
                else:namelist.append(L[2])

            paixu_buytime=(lambda x:(x.sort(),x)[1])(timelist)  #根据时间进行排序

            sumdata['paixu_buytime']=paixu_buytime
            sumdata['phone']=','.join(phone)
            sumdata['namelist']=','.join(namelist)
            sumdata['money']=money
            sumdata['shangping_num']=shangping_num
            d[data].append(sumdata)

        return d
    #从数据库中获取联通数据
    def get_lt_data(self,oid):
        # sql='select buytime,order_number,promotion_way,number,buyer,address,phone_number,total_amount,trade_name from jd'
        sql="select callphone,thtypeName,romatypeName,othernum,otherfee,otherarea,nativefee,longtype,landtype,homeareaName,homearea,calltypeName,calltime,calllonghour,calldate from LT WHERE oid='%s'"%oid

        cur.execute(sql)
        da=cur.fetchall()
        data=[]
        for i in da:
            data.append(i)
        #统计被叫主叫次数及时间
        sumdata={}
        sumdata['phonedata']={}
        sumdata['otherarea']={}
        sumdata['monthdata']={}
        phonedata=sumdata['phonedata']
        eraedata=sumdata['otherarea']
        monthdata=sumdata['monthdata']
        for t in data:
            pass
            #统计所有的被叫及主叫次数以及所有的通话时间
            phonedata[t[3]]={}

            phonedata[t[3]]['beijiao']=0  #被叫
            phonedata[t[3]]['zhujiao']=0   #主叫
            phonedata[t[3]]['calltime']=0   #通话时间

            #统计不同地区
            eraedata[t[5]]={}
            eraedata[t[5]]['phonelist']=[]
            eraedata[t[5]]['phones']=0
            eraedata[t[5]]['callintimes']=0
            eraedata[t[5]]['callintime']=0
            eraedata[t[5]]['callouttimes']=0
            eraedata[t[5]]['callouttime']=0

            #统计不同时间段内
            yuefen=t[14][:7]
            monthdata[yuefen]={}
            monthdata[yuefen]['phonenum']=''
            monthdata[yuefen]['homeerae_name']=''
            monthdata[yuefen]['callouttime']=0
            monthdata[yuefen]['callintime']=0
            monthdata[yuefen]['sms']=0 #短信
            monthdata[yuefen]['data_flow']=0  #流量

            # monthdata[t[14]]['phonenum']=''
            # monthdata[t[14]]['homeerae_name']=''

        for t in data:
            pass

            yuefen=t[14][:7]  #只获取月份

            #统计地区电话号码数量
            phonelist=eraedata[t[5]]['phonelist']
            if t[3] in phonelist:
                pass
            else:
                phonelist.append(t[3])

            eraedata[t[5]]['phones']=len(eraedata[t[5]]['phonelist'])  #统计同一取出现的号码数量

            monthdata[yuefen]['phonenum']=t[0]
            monthdata[yuefen]['homeerae_name']=t[9]

            if t[11]==u'被叫':
                phonedata[t[3]]['beijiao']+=1
                eraedata[t[5]]['callintimes']+=1  #呼入次数统计
                eraedata[t[5]]['callintime']=eraedata[t[5]]['callintime']+int(t[13])

                monthdata[yuefen]['callintime']=monthdata[yuefen]['callintime']+int(t[13])

            else:
                phonedata[t[3]]['zhujiao']+=1
                eraedata[t[5]]['callouttimes']+=1  #呼出次数统计
                eraedata[t[5]]['callouttime']=eraedata[t[5]]['callouttime']+int(t[13])

                monthdata[yuefen]['callintime']=monthdata[yuefen]['callintime']+int(t[13])

            phonedata[t[3]]['calltime']+=int(t[13])

            phonedata[t[3]]['otherarea']=t[5]
            phonedata[t[3]]['allphone_times']=phonedata[t[3]]['zhujiao']+phonedata[t[3]]['beijiao']

        return sumdata

